import React from "react";
import ReactPaginate from "react-paginate";
import "./style.css";

export default function BasicPagination({ postsPerPage, totalPosts }) {
  const count = Math.ceil(totalPosts / postsPerPage);

  return (
    <div className="pagination">
      <ReactPaginate breakLabel="..." nextLabel="->" pageCount={count} />
    </div>
  );
}
